    def __init__(self):
        self.file = set()
        self.task = None

    def run(self):
        window = self.home()
        if not os.path.exists(ROOT):
            os.mkdir(ROOT)
        else:
            window.find_element('status').update(
                'cache', text_color="red")
        while True:
            event, values = window.read(timeout=100)
            if event is None:
                break
            elif event == 'choice':
                window['choice'].update(disabled=True)
                cache = self.choice_file()
                if cache:
                    [self.file.add(i) for i in cache]
                    window.find_element('screen').update('\n'.join(self.file))
                window['choice'].update(disabled=False)
            elif event == 'reset':
                self.file = set()
                window.find_element('screen').update('')
            elif event == '':
                if not self.file:
                    window.find_element('status').update('')
                    continue
                self.task = threading.Thread(
                    target=self.deal,
                    args=(
                        window,
                        values['A'],
                        values['low'],
                        self.file),
                    daemon=True)
                self.task.start()
                window.find_element('status').update('')
            elif event == 'all':
                self.task = threading.Thread(
                    target=self.deal, args=(
                        window, values['A'], values['low']), daemon=True)
                self.task.start()
                window.find_element('status').update('')
            elif event == 'info':
                webbrowser.open(
                    'https://github.com/JoeanAmiee/Private_office_tools')
            if self.task:
                window['choice'].update(disabled=True)
                window['reset'].update(disabled=True)
                window[''].update(disabled=True)
                window['all'].update(disabled=True)
                sg.popup_animated(
                    self.GIF,
                    message='',
                    text_color='black',
                    font=('', 12),
                    icon=self.ICO,
                    background_color='white',
                    transparent_color='white',
                    time_between_frames=100)
                self.task.join(timeout=0)
                if not self.task.is_alive():
                    sg.popup_animated(None)
                    self.task = None
                    window['choice'].update(disabled=False)
                    window['reset'].update(disabled=False)
                    window[''].update(disabled=False)
                    window['all'].update(disabled=False)
        window.close()
        if not os.listdir(ROOT):
            os.rmdir(ROOT)

